parts:
{
  "name": "UBX-SEC-SIGLOG",
  "class_id": "0x27",
  "message_id": "0x10",
  "message_type": "periodic_polled",
  "payload_length": {
    "variable": {
      "base": 8,
      "formula": "8 + numEvents * 8"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x01 for this version)",
      "fixed_value": 1
    },
    {
      "byte_offset": 1,
      "data_type": "U1",
      "name": "numEvents",
      "description": "Number of events"
    },
    {
      "byte_offset": 2,
      "data_type": {
        "array_of": "U1",
        "count": 6
      },
      "name": "reserved0",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 8,
      "name": "events",
      "array_of_elements": {
        "count_field": "numEvents",
        "elements": [
          {
            "byte_offset": 0,
            "data_type": "U4",
            "name": "timeElapsed",
            "unit": "S",
            "description": "Seconds elapsed since this event Special value 0xFFFFFFFF: more than 45 days"
          },
          {
            "byte_offset": 4,
            "data_type": "U1",
            "name": "detectionType",
            "description": "Type of the spoofing or jamming detection:",
            "enum_values": {
              "0": "simulated signal",
              "1": "abnormal signal",
              "2": "INS/GNSS mismatch",
              "3": "abrupt changes in GNSS signal",
              "4": "jamming indicated",
              "5": "authentication failed",
              "6": "replayed signals"
            }
          },
          {
            "byte_offset": 5,
            "data_type": "U1",
            "name": "eventType",
            "description": "Type of the event:",
            "enum_values": {
              "0": "indication started",
              "1": "indication stopped",
              "2": "indication triggered",
              "3": "indication timed-out"
            }
          },
          {
            "byte_offset": 6,
            "data_type": {
              "array_of": "U1",
              "count": 2
            },
            "name": "reserved1",
            "description": "Reserved",
            "reserved": true
          }
        ]
      }
    }
  ]
}
